import React from 'react';
import ReactDom from 'react-dom';

let img1='https://picsum.photos/200/300';
let img2='https://picsum.photos/200/400';
let img3='https://picsum.photos/200/00';

ReactDom.render(
    <>

    <h1 contentEditable='true'>my name is satish maurya</h1>

    <img src={img1} />
    <img src={img2} />
    <img src={img3} />

    </>,document.getElementById('root')
)
